import React from "react";
import "./IntroLandstyle.css";

export const Frame = () => {
  return (
    <div className="frame">
      <div className="div">
        <div className="text-wrapper">product designer</div>
        <div className="text-wrapper-2">KHOI NGUYEN</div>
      </div>
      <p className="p">based in san diego, ca</p>
    </div>
  );
};
